class App extends Component {
  render() {
    return (
      <HashRouter>      
           <div className = 'app-wrapper' >  
           <div className = 'app-wrapper-content'>            

           < MusicList/>

           </div>
    </div>
      </HashRouter>
    );
  }
}
export default App;
